import React from 'react'
import { Input, Navbar , Title , User } from './Styled';
import search from "../assets/search.png";

function Nav() {
  return (
    <Navbar>
      <Title align="left">Musicly</Title>
      div
      <Input></Input>
      <img src={search} alt="icon" width="20px" height="20px" />

      <User>John Doe</User>
    </Navbar>
  );
}

export default Nav
